{"cells":[{"source":"<a href=\"https://www.kaggle.com/kavitakhandelwal1234/bellabeat-case-study-r?scriptVersionId=85990622\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"dfd5b9b8","metadata":{"papermill":{"duration":0.022602,"end_time":"2022-01-24T02:19:43.377598","exception":false,"start_time":"2022-01-24T02:19:43.354996","status":"completed"},"tags":[]},"source":["# Bellabeat \n","## Introduction\n","\n","Urška Sršen and Sando Mur founded Bellabeat, a high-tech company that manufactures health-focused smart products. Sršen used her background as an artist to develop beautifully designed technology that informs and inspires women around the world. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women.\n","\n","## Ask\n","* **Business Task**\n","\n","Focus on one of Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices and by these insights make a marketing strategy. \n","\n","\n","* **Stakeholders**\n","1. Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer\n","2. Sando Mur: Mathematician and Bellabeat’s cofounder\n","3. Bellabeat marketing analytics team\n","\n","\n","## Prepare\n","* **Data Information**\n","\n","This is a public data that explores smart device users’ daily habits. You can download data set [here](https://www.kaggle.com/arashnic/fitbit). This Kaggle data set contains personal fitness tracker from thirty fitbit users. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, and heart rate that can be used to explore users’ habits. "]},{"cell_type":"markdown","id":"0459ffbd","metadata":{"papermill":{"duration":0.019216,"end_time":"2022-01-24T02:19:43.416157","exception":false,"start_time":"2022-01-24T02:19:43.396941","status":"completed"},"tags":[]},"source":["* **Install and Load Packages**"]},{"cell_type":"code","execution_count":1,"id":"ce1910aa","metadata":{"execution":{"iopub.execute_input":"2022-01-24T02:19:43.463109Z","iopub.status.busy":"2022-01-24T02:19:43.45998Z","iopub.status.idle":"2022-01-24T02:19:44.875353Z","shell.execute_reply":"2022-01-24T02:19:44.873419Z"},"papermill":{"duration":1.440035,"end_time":"2022-01-24T02:19:44.87552","exception":false,"start_time":"2022-01-24T02:19:43.435485","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.4     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.2     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.3     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 1.4.0     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, inte