d(cor(df2), 2)\n","ggcorrplot(df2_cor, lab = TRUE)"]},{"cell_type":"markdown","id":"d10df384","metadata":{"papermill":{"duration":0.061303,"end_time":"2022-01-24T02:19:53.638543","exception":false,"start_time":"2022-01-24T02:19:53.57724","status":"completed"},"tags":[]},"source":["* **Analysis**\n","\n","Some interesting insights by visualizations are:\n","1. The graph between total distance vs. calories filled with total sleeping time is showing that people who sleep between 6h-8h are walking more distance and burning more calories than people who sleep less (<6 hours) or more (>8 hours).\n","2. The graph between total steps vs. calories filled with total sleeping time is showing that people who sleep between 6h-8h are taking 14,000 to 20,000 steps and burning more calories than people who sleep less  or more hours.\n","3. The graph between day of week and calories shows that people are burning more calories on Tuesday, Wednesday, Thursday and Saturday than remaining days.\n","4. The graph between day of week and total steps shows that people are walking more steps on Tuesday, Wednesday, Thursday and Saturday than remaining days .\n","5. The graph between day of week and total distance shows that people are taking more distance on Tuesday, Wednesday, Thursday and Saturday than other days.\n","6. The boxplot between day of week and total time in bed shows sunday are the most affected, where the time in bed ranges from 8–10 hours. The Netflix Binge and weekend parties are some of the vices which have affected this routine.\n","7. The correlation plot shows that logged activities distance, light active distance and very active distance are burning more calories than moderately active distance and sedentary active distance.\n","8. The correlation plot shows that very active minutes are burning more calories than lightly active minutes and sedentary active minutes."]},{"cell_type":"markdown","id":"c7b628a1","metadata":{"papermill":{"duration":0.061528,"end_time":"2022-01-24T02:19:53.761453","exception":false,"start_time":"2022-01-24T02:19:53.699925","status":"completed"},"tags":[]},"source":["## Recommendations\n","On the basis of conducted analysis, these are my recommendations to the marketing team members:\n","1. Average steps are 7638 for this data set but Centers for Disease Control and Prevention (CDC) recommends    10,000 steps per day for healthy adults. Bellabeat can improve the product by sending reminder to reach their target.\n","2. The average distance is 5.49 km but Centers for Disease Control and Prevention (CDC) recommends 8 km per day for adults. Bellabeat can improve the product by sending reminder to reach their goal.\n","3. People who sleep 6-8 hours, they burn more calories so send them notifications to sleep 6 to 8 hours, total sleep hours and how many hours more they need to reach their target. Tell people that good sleeping habit can also improve other health problems.\n","4. Motivate people to do more exercise on Monday, Friday and Sunday.\n","5. Motivate people to do more logged activities distance, light active distance and very active distance, because they are burning more calories.\n","6. Motivate people to do Very active minutes, because they are burning more calories.\n","7. **The most important thing is when they do advertisement for fitbit, they have to show that fitbit has reminder feature so customers can set their goals according to their health condition.**"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":13.952221,"end_time":"2022-01-24T02:19:53.935371","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-01-24T02:19:39.98315","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}